            if (response.data) {

                {Object.keys(response.data).map((keyName, i) => {
                    console.log(response.data[keyName]);
                    // this.setState({
                    //     plantId: response.data[keyName].plantId,
                    //     plantNaam: response.data[keyName].body
                    // })
                    this.setState({
                        test: response.data
                    })

                    return <Row>
                                <div className="col">key: {i} Name: {response.data[keyName]} </div>
                            </Row>      // use return here
                })}

            }
          })
          .catch(error => {
            console.log(error)
          })
      }
      
      componentWillMount() {
        this.logPlants()
      }


    render() {
        return ( 
            <div>
                <h2>Planten</h2>
                <Row>
                    <div className="col">test</div>
                    <div className="col">{this.state}</div> 
                </Row>
            </div>
        )
    }
}

export default Planten
